import React from 'react';
import './App.css';

import AppHeader from './components/AppHeader';
import BurgerContent from './components/BurgerContent';
import ModalTest from './utils/modal-test/modal-test';



function App() {
  return (
    <div className="App">
      <AppHeader />
      <BurgerContent />
<ModalTest />
    </div>
  );
}

export default App;
